create table EVENT (
	name_id VARCHAR(50),
	curr_ts DATE,
	event_status VARCHAR(9),
	event_timestamp DATE,
	location VARCHAR(17),
	exit_event DECIMAL(10,2),
	matched VARCHAR(50),
	product_image_url VARCHAR(50),
	product_name VARCHAR(3),
	product_price VARCHAR(50),
	reader_id VARCHAR(8),
	register INT,
	store VARCHAR(2),
	tag_id VARCHAR(9),
	upc VARCHAR(3),
	video_url VARCHAR(50),
	validation_status INT
);
